const Index = () => {
  return (
    <div style={{ padding: '2.5rem', minHeight: 'calc(100vh - 80px)' }}>
      <h1>Welcome to Smart Seat</h1>
      <p style={{ color: '#64748b', fontSize: '1.1rem', marginTop: '1.5rem', maxWidth: '800px' }}>
        Efficiently reserve seats in classrooms, canteen, or library with our smart reservation system.
        Select "Seat" from the navigation menu to start your reservation.
      </p>
    </div>
  );
};

export default Index;
